<script lang="ts">
import { DestinationData } from '@/ViewModels/DestinationData';
import { defineComponent, reactive, ReactiveEffect, ref } from 'vue';
import InputField from './InputField.vue';
import IconDelete from './icons/IconDelete.vue';
import TextArea from './TextArea.vue';
import Checkbox from './Checkbox.vue';
import Print from './Print.vue';
import { DestinationDatav2 } from '@/ViewModels/DestinationDatav2';
import type { DrivingReportV2 } from '@/ViewModels/DrivingReportv2';

export default defineComponent({
	props: {
		report: {
			type: Object,
			required: true,
			default: {},
		},
	},
	setup() {
		return {
			destinationDataIdCounter: 0,
			printWithBackground: ref(false),
		};
	},
	data() {
		return {
			reportWithType: this.report as DrivingReportV2,
		}
	},
	watch: {
		report() {
			this.reportWithType = this.report as DrivingReportV2;
		}
	},
	methods: {
		GetCurrentTime() {
			const coeff = 1000 * 60 * 5; // 5 minutes
			let date = new Date();
			let rounded = new Date(Math.round(date.getTime() / coeff) * coeff);
			return rounded.toTimeString().split(' ')[0].substring(0, 5);
		},
		AddDestinationDataRow() {
			let data = new DestinationDatav2(this.destinationDataIdCounter);
			data.startTime = this.GetCurrentTime();
			if (this.report.destinationData.length > 0) {
				let lastData =
					this.report.destinationData[
						this.report.destinationData.length - 1
					];

				if (
					lastData.endTime == undefined ||
					lastData.endTime == ''
				) {
					this.report.destinationData[
						this.report.destinationData.length - 1
					].endTime = data.startTime;
				}
				this.report.endTime =
					this.report.destinationData[
						this.report.destinationData.length - 1
					].endTime;
			}

			this.report.destinationData.push(data);
			this.destinationDataIdCounter++;
		},
		DeleteDestinationDataRow(index: number) {
			this.report.destinationData.splice(index, 1);
		},
		StartDestination() {
			if (this.CanAddMoreRows) this.AddDestinationDataRow();
		},
		EndDestination() {
			if (this.report.destinationData.length > 0) {
				this.report.destinationData[
					this.report.destinationData.length - 1
				].endTime = this.GetCurrentTime();
				this.report.endTime =
					this.report.destinationData[
						this.report.destinationData.length - 1
					].endTime;
				this.report.endKmCount =
					this.report.destinationData[
						this.report.destinationData.length - 1
					].kmCount - this.report.destinationData[0].kmCount;
			}
		},
		Print() {
			this.$refs.print.Print();
		},
		FormatDate(data: Date) {
			if (data == undefined)
				return "";
			let date = new Date(data);
			let day, month, year;
			day = date.getDate();
			month = date.getMonth() + 1;
			year = date.getFullYear();
			if (day < 10) day = '0' + day;
			if (month < 10) month = '0' + month;
			return `${day}/${month}`;
		}
	},
	computed: {
		CanAddMoreRows() {
			if (!this.report) return false;
			if (!this.report.destinationData) return false;
			return (
				this.report.destinationData.length < this.report.maxDataCount
			);
		},
		FormattedDate() {
			if (!this.report) return;
			let date = this.report.date;
			if (typeof date == 'string') {
				date = new Date(date);
			}
			let day, month, year;
			day = date.getDate();
			month = date.getMonth() + 1;
			year = date.getFullYear();
			if (day < 10) day = '0' + day;
			if (month < 10) month = '0' + month;
			return `${day}/${month}-${year}`;
		},
		PrintCss() {
			if (this.printWithBackground) {
				return `
					@page {
						margin: 0;
						size: A4;
					}

					.print-container {
						position: absolute;
						top: 0;
						left: 0;
						width: 21cm;
						height: 29.7cm
					}

					.background-image {
						position: absolute;
						left: 0;
						top: 0;
						width: 21cm;
						height: 29.7cm
					}

					span {
						color: black;
						font-weight: 600;
						font-size: 12pt;
						line-height: 18.4pt;
						z-index: 2;
					}
					.report {
						position: absolute;
						top: .3cm;
						right: 1cm;
						letter-spacing: 1pt;
						font-size: 20pt;
						text-align: right;
					}
					.name {
						position: absolute;
						top: 1.15cm;
						left: 3cm;
					}
					.car-reg-number {
						position: absolute;
						top: 1.85cm;
						left: 3cm;
					}
					.date {
						position: absolute;
						top: 4.55cm;
						left: 13cm;
					}
					.salary-number {
						position: absolute;
						top: 1.15cm;
						left: 17cm;
					}

					.destination-details-list {
						display: flex;
						flex-direction: column;
						position: absolute;
						top: 3.25cm;
						left: 1cm;
					}

					.destination-details-row {
						display: grid;
						grid-template-columns: 5.6cm 1.25cm 1.8cm 1.8cm 1.5cm 2.2cm 5.2cm;
					}

					.destination-details-row span {
						padding-left: 0.1cm;
					}

					.end-time,
					.km-count,
					.start-time,
					.route-date {
						text-align: center;
						padding: 0 !important;
					}

					.end-time {
						position: relative;
					}

					.end-time span {
						position: absolute;
						top: .65cm;
						left: 0;
						right: 0;
					}

					.route, .work-type {
						text-align: left;
						padding: 0 0 0 .1cm !important;
					}`;
			} else {
				return `
					@page {
						margin: 0;
						size: A4;
					}

					.print-container {
						position: absolute;
						top: 0;
						left: 0;
						width: 21cm;
						height: 29.7cm
					}

					.background-image {
						display: none;
					}

					span {
						color: black;
						font-weight: 600;
						font-size: 12pt;
						line-height: 18.4pt;
						z-index: 2;
					}
					.report {
						display: none;
					}
					.name {
						position: absolute;
						top: 1.15cm;
						left: 3cm;
					}
					.car-reg-number {
						position: absolute;
						top: 1.85cm;
						left: 3cm;
					}
					.date {
						position: absolute;
						top: 4.55cm;
						left: 13cm;
					}
					.salary-number {
						position: absolute;
						top: 1.15cm;
						left: 17cm;
					}

					.destination-details-list {
						display: flex;
						flex-direction: column;
						position: absolute;
						top: 3.25cm;
						left: 1cm;
					}

					.destination-details-row {
						display: grid;
						grid-template-columns: 5.6cm 1.25cm 1.8cm 1.8cm 1.5cm 2.2cm 5.2cm;
					}

					.destination-details-row span {
						padding-left: 0.1cm;
					}

					.end-time,
					.km-count,
					.start-time,
					.route-date {
						text-align: center;
						padding: 0 !important;
					}

					.end-time {
						position: relative;
					}

					.end-time span {
						position: absolute;
						top: .65cm;
						left: 0;
						right: 0;
					}

					.route, .work-type {
						text-align: left;
						padding: 0 0 0 .1cm !important;
					}`;
			}
		},
		ReportDate: {
			get() {
				return this.report.date;
			},
			set(newValue: string) {
				this.report.date = newValue;
				this.report.fullDate = new Date(newValue);
			},
		},
	},
	components: { InputField, IconDelete, TextArea, Checkbox, Print },
});
</script>

<template>
	<div class="report">
		<div class="report-general details">
			<h2>Generelle oplysninger</h2>
			<div class="inputs">
				<InputField
					type="number"
					v-model="report.reportNumber"
					label="Rapport nummer"
					pattern="[0-9]+"
				></InputField>
				<InputField
					type="date"
					v-model="ReportDate"
					label="Dato"
					:required="true"
				></InputField>
			</div>
		</div>
		<div class="personal-details details">
			<h2>Personlige oplysninger</h2>
			<div class="inputs">
				<InputField
					type="text"
					v-model="report.name"
					label="Navn"
				></InputField>
				<InputField
					type="string"
					v-model="report.carRegNumber"
					label="Bil registerings nummer"
				></InputField>
				<InputField
					type="string"
					v-model="report.salaryNumber"
					label="Løn nummer"
				></InputField>
			</div>
		</div>
		<div class="main-details details">
			<h2>Kørsel oplysninger</h2>
			<div class="data-list" v-if="report.destinationData.length > 0">
				<div
					class="data-list-row"
					v-for="(data, index) in report.destinationData"
					:key="data.id"
				>
					<IconDelete
						class="delete"
						@click="DeleteDestinationDataRow(index)"
					></IconDelete>
					<div class="inputs">
						<InputField
							type="text"
							v-model="data.route"
							label="Rute"
							max-length="21"
						></InputField>
						<InputField
							type="date"
							v-model="data.date"
							label="Dato"
						></InputField>
						<InputField
							type="text"
							v-model="data.startTime"
							label="Start kl."
						></InputField>
						<InputField
							type="text"
							v-model="data.endTime"
							label="Slut kl."
						></InputField>
						<InputField
							type="text"
							v-model="data.kmCount"
							label="Speed-km"
						></InputField>
						<InputField
							type="text"
							v-model="data.workType"
							label="Arbejdets art/Godsets art/KG"
						></InputField>
					</div>
				</div>
			</div>
			<div v-else class="no-destinations">
				<h2>
					Der er ikke tilføjet nogle destinationer endnu. Klik på
					'START DESTINATION' for at tilføje en destination.
				</h2>
			</div>
			<div class="data-list-overall">
				<div
					class="btn start-btn"
					:class="{ disabled: !CanAddMoreRows }"
					@click="StartDestination"
				>
					Start destination
				</div>
				<div class="btn end-btn" @click="EndDestination">
					Slut destination
				</div>
			</div>
		</div>
		<div class="print">
			<Checkbox
				v-model="printWithBackground"
				label="Print med baggrund"
				name="printWithBackground"
			></Checkbox>
			<div class="btn print-btn" @click="Print">Print</div>
		</div>
	</div>
	<Print ref="print" :print-style="PrintCss" class="print">
		<template v-slot:print class="print">
			<img
				class="background-image"
				src="data:image/png;base64,"
			/>
			<span class="report">{{ reportWithType.reportNumber }}</span>
			<span class="name">{{ reportWithType.name }}</span>
			<span class="car-reg-number">{{ reportWithType.carRegNumber }}</span>
			<span class="salary-number">{{ reportWithType.salaryNumber }}</span>
			<div class="destination-details-list">
				<div
					class="destination-details-row"
					v-for="destination in reportWithType.destinationData"
				>
					<span class="route">{{
						destination.route
					}}</span>
					<span class="route-date">{{
						FormatDate(destination.date)
					}}</span>
					<span class="end-time"><span>{{ destination.endTime }}</span></span>
					<span class="start-time">{{ destination.startTime }}</span>
					<span class="hours"></span>
					<span class="km-count">{{ destination.kmCount }}</span>
					<span class="work-type">{{
						destination.workType
					}}</span>
				</div>
			</div>
			<span class="final-km-count">{{ report.endKmCount }}</span>
			<div class="crossings">
				<div class="crossing" v-for="crossing in report.crossings">
					<span>{{ crossing.Solo > 0 ? crossing.Solo : null }}</span
					><span>{{
						crossing.Trailer > 0 ? crossing.Trailer : null
					}}</span
					><span>{{
						crossing.Modul > 0 ? crossing.Modul : null
					}}</span>
				</div>
				<span class="seafareCrossingName">{{report.seafareCrossingName}}</span>
			</div>
			<div class="additional-details">
				<span>{{ report.additionalDetails }}</span>
			</div>
		</template>
	</Print>
</template>

